import { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMapLocationDot } from '@fortawesome/free-solid-svg-icons';

function Icon() {
    const handleScroll = () => {
      const el = document.querySelector('.new-div');
      el.scrollIntoView({ behavior: 'smooth' });
    }
  
    return (
      <div>
        <FontAwesomeIcon icon={faMapLocationDot} className="my-icon" onClick={handleScroll} />
        {/* Other content of the component */}
        <div className="new-div">This is the new div</div>
      </div>
    );
  }

export default Icon;
